{
    "First Name": {
        "key": "first_name",
        "transform": "trim"
    },
    "Last Name": {
        "key": "last_name",
        "transform": "trim"
    },
    "Work Email": {
        "key": "email?",
        "transform": "email"
    },
    "Home Phone": "phone?",
    "Relationship to Subscriber": {
        "key": "role",
        "transform": "role:employee|EE,spouse|SP,child|CH",
        "default": "EE"
    },
    "Date of Birth": {
        "key": "dob",
        "transform": "date:MM/DD/YYYY"
    },
    "Gender": {
        "key": "gender",
        "transform": "gender"
    },
    "Member ID": "reseller_employee_id",
    "Subscriber ID": "employee_id",
    "Address 1": "address_1",
    "Address 2": "address_2",
    "City": "city",
    "State": "state",
    "Postal Code": "zipcode",
    "Region": "group_name",
    "Job Family": "line_of_business",
    "Management Level": "attribute_1",
    "Benefit Coverage": "attribute_2"
}

